const Kanban = () => {
  return (
    <KanbanComponent id="kanban" dataSource={kanbanData}>
      <ColumnsDirective>
        {kanbanGrid.map((item, index) => (
          <ColumnDirective key={index} {...item} />
        ))}
      </ColumnsDirective>
    </KanbanComponent>
  );
};

export default Kanban;
